package util;

import java.util.Enumeration;
import java.util.Hashtable;

import javax.servlet.ServletContext;

/**
 * Provides access to a set of context parameters set within web.xml
 * 
 * The object loads the context parameters based on the first ConfigHttpServlet
 * that is loaded.
 * 
 * @author dddurand
 *
 */
public class ServletConfiguration {

	/*
	 * Parameter Names
	 */
	private static final String PARAM_DATABASE_NAME = "database";
	private static final String PARAM_DEBUG = "debug";
	
	/*
	 * Set Primitive Values
	 */
	private static final String TRUE_VALUE = "true";
	//private static final String FALSE_VALUE = "false";
	
	/*
	 * Location Specific Values
	 */
	private static final String LOCATION_HOME = "home";
	private static final String LOCATION_UNI = "uni";
	
	/*
	 * Static table that contains loaded context parameter values
	 */
	private static Hashtable<String, Object> paramTable = null;
	
	
	/**
	 * Attempts to load the context. If the context is already loaded,
	 * it is simply ignored. Note: This method is not thread safe on purpose,
	 * and is handled within loadContextParameters.
	 */
	public static void loadContext(ServletContext context)
	{
		if(paramTable == null)
		{
			loadContextParameters(context);
		}
	}
	
	/**
	 * A sync. method that loads the context parameters into the parameters table.
	 * A check is done to ensure thread safeness.(Returns on case when table already completed).
	 * 
	 * Loads all context parameters for the given context into the table.
	 */
	private static synchronized void loadContextParameters(ServletContext context) {
		
		//We are rechecking this to ensure no threading issues. We do this to
		//make loadContext function much faster(not limited to single call) once the singleton has been loaded, while
		//ensuring that threading is not an issue.
		if(paramTable != null) return;
		paramTable = new Hashtable<String, Object>();
		
		
		Enumeration<String> paramNames = context.getInitParameterNames();
		
		while(paramNames.hasMoreElements())
		{
			String parameter = paramNames.nextElement();
			String value = context.getInitParameter(parameter);
			
			processParameter(parameter, value);

		}	
	}
	
	/**
	 * Processes each parameter based on its parameter name.
	 * 
	 * @param param Parameter Name
	 * @param value Parameter Value
	 */
	private static void processParameter(String param, String value)
	{
		if(param.equals(PARAM_DATABASE_NAME))
			processDatabaseName(param, value);
		else if(param.equals(PARAM_DEBUG))
			processDebug(param, value);
	}
	
	/**
	 * Processes a location parameter and loads the appropriate value into the
	 * table, based on the string value provided.
	 * 
	 * If no valid location is provided, a default of home is loaded.
	 * @param param Parameter Name
	 * @param value Parameter String Value
	 */
	private static void processDatabaseName(String param, String value)
	{
		if(value.equals(LOCATION_UNI))
			paramTable.put(param, Database.UNIVERSITY);
		else if(value.equals(LOCATION_HOME))
			paramTable.put(param, Database.HOME);
		else//Redundant, but for readability
			paramTable.put(param, Database.HOME);
	}
	
	/**
	 * Process debug parameter and loads its value into the table.
	 * 
	 * Assumed false, if doesn't exactly match true value.
	 * 
	 * @param param Parameter Name
	 * @param value Parameter String Value
	 */
	private static void processDebug(String param, String value)
	{
		if(value.equals(TRUE_VALUE))
			paramTable.put(param, new Boolean(true));
		else
			paramTable.put(param, new Boolean(false));
	}
	
	/**
	 * Location Enum
	 * @author dddurand
	 *
	 */
	public enum Database {
		HOME, UNIVERSITY
	}
	
	/*
	 *  --------Parameter Getters-------------
	 */
	
	/**
	 * Retrieves the location parameter.
	 * @return Location Value
	 */
	public static Database getDatabase()
	{
		return (Database) paramTable.get(PARAM_DATABASE_NAME);
	}
	
	/**
	 * Retrieves whether the servlet is set as debug.
	 * @return Location Value
	 */
	public static boolean isDebug()
	{
		return (Boolean) paramTable.get(PARAM_DEBUG);
	}
	
}

package util;

import java.util.ArrayList;
import java.util.TimerTask;

import javax.servlet.ServletContext;

import dataModels.Account;
import dataModels.Filter;
import dataModels.PersonalStatistics;
import database.DatabaseInterface;
import database.DatabaseInterface.DatabaseInterfaceException;

/**
 * The cron process that updates the ranking caches.
 * 
 * @author dddurand
 *
 */
public class RankCacheCron extends TimerTask {

	private ServletContext context;
	
	public RankCacheCron(ServletContext context)
	{
		this.context = context;
	}
	
	/**
	 * For each account with an expired cache, we update their rank cache.
	 * 
	 */
		@Override
		public void run() {
			
			context.log("Ranking Cache Cron Started...");
					
			DatabaseInterface dbInterface;
			try {
				dbInterface = new DatabaseInterface();
				ArrayList<Account> accounts = dbInterface.getAllAccounts();
				
				for(Account account : accounts)
				{
					if(!dbInterface.isRankCacheCurrent(account))
					{
						Filter filter = new Filter();
						PersonalStatistics stats = new PersonalStatistics(account, dbInterface, filter);
						stats.updateRankings();
					}
				}
				
				dbInterface.close();
				
				
			} catch (DatabaseInterfaceException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
			
			context.log("Ranking Cache Cron Complete...");
			
		}
		

}

package util;


import java.io.FileNotFoundException;
import java.io.IOException;
import java.io.InputStream;
import java.util.ArrayList;
import java.util.HashMap;

import dataModels.Card;
import dataModels.Card.Number;
import dataModels.Card.Suit;

/**
 * This class provides an efficient means to determine poker hands rankings,
 * and types.
 * 
 * The class uses a lookup table derived from:
 * This code forms the basis of the "Two Plus Two 7-Card Evaluator" developed by the 2+2
   crowd and packaged into reference form by Ray Wotton.
 *  
 * Adapted from:
 * http://www.codingthewheel.com/archives/poker-hand-evaluator-roundup/#2p2
 * http://pokerai.org/pf3/viewtopic.php?f=3&t=4388
 * https://gist.github.com/eluctari/832122
 *   
 * 
 * @author dddurand
 *
 */
public class PokerHandRanker {
	
	//private static final String[] HANDRANKS = {"BAD!!","High Card","Pair","Two Pair","Three of a Kind","Straight","Flush","Full House","Four of a Kind","Straight Flush"};
	private static final int TABLE_SIZE = 32487834;
	private static final int INT_SIZE = 4;
	private static final int[] HR = new int[TABLE_SIZE];
	
	private static final HashMap<Suit, Integer> suits = new HashMap<Suit, Integer>();
	private static final HashMap<Number, Integer> numbers = new HashMap<Number, Integer>();
	
	/**
	 * Load table into memory when class is initially created
	 * Everything is read only, so we don't worry about sync. issues.
	 * 
	 * Adapted from:
	 * https://gist.github.com/eluctari/832122
	 * 
	 */
	static {
        int tableSize = TABLE_SIZE * INT_SIZE;
        byte[] b = new byte[tableSize];
        InputStream input = null;
        try {
        	ClassLoader classLoader = Thread.currentThread().getContextClassLoader();
        	input = classLoader.getResourceAsStream("../tables/HandRanks.dat");
        	input.read(b, 0, tableSize);
        } catch (FileNotFoundException e) {
           e.printStackTrace();
        } catch (IOException e) {
        	e.printStackTrace();
        } finally {
            try {
            	input.close();
            } catch (IOException e) {
            	e.printStackTrace();
            }
            
            for (int i = 0; i < TABLE_SIZE; i++) {
                HR[i] = littleEndianByteArrayToInt(b, i * 4);
            }
            
            initCardConversion();
        }
    }
	
	private static void initCardConversion()
	{
		suits.put(Suit.CLUBS,new Integer(0));
		suits.put(Suit.DIAMONDS,new Integer(1));
		suits.put(Suit.HEARTS,new Integer(2));
		suits.put(Suit.SPADES,new Integer(3));
		
		numbers.put(Number.TWO,new Integer(0));
		numbers.put(Number.THREE,new Integer(1));
		numbers.put(Number.FOUR,new Integer(2));
		numbers.put(Number.FIVE,new Integer(3));
		numbers.put(Number.SIX,new Integer(4));
		numbers.put(Number.SEVEN,new Integer(5));
		numbers.put(Number.EIGHT,new Integer(6));
		numbers.put(Number.NINE,new Integer(7));
		numbers.put(Number.TEN,new Integer(8));
		numbers.put(Number.JACK,new Integer(9));
		numbers.put(Number.QUEEN,new Integer(10));
		numbers.put(Number.KING,new Integer(11));
		numbers.put(Number.ACE,new Integer(12));
		
	}
	
	/**
     * Converts a little-endian byte array to a Java (big-endian) integer.
     * We need this because the HandRanks.dat file was generated using
     * a little-endian C program and we want to maintain compatibility.
     * 
     * Cited:
     * https://gist.github.com/eluctari/832122
     * 
     * @param b
     * @param offset
     * @return
     */
    private static final int littleEndianByteArrayToInt(byte[] b, int offset) {
        return (b[offset + 3] << 24) + ((b[offset + 2] & 0xFF) << 16)
                + ((b[offset + 1] & 0xFF) << 8) + (b[offset] & 0xFF);
    }
	
    /**
     * An adapted algorithm for determining a cards ranking & type.
     * 
     * Adapted from:
     * http://pokerai.org/pf3/viewtopic.php?f=3&t=4388
     * 
     * @param pCards
     * @return
     */
	public static int lookupHand(int[] pCards)
	{
	   int numCards = pCards.length;
	   int position = 0;
	   int initialOffset = 53;
	   
	   for(int i = 0; i < numCards; ++i)
	      {
		   initialOffset = HR[initialOffset + pCards[position++]];
	      }
	   
	   // Extra lookup pre-river
	   if(numCards < 7)
	   {
		   initialOffset= HR[initialOffset];
	   }
	      
	   return initialOffset;
	}
	
	/**
	 * Converts a given card into its int equivilent in the lookup table
	 * 
	 * @param card Card to be converted
	 * @return Card's int representation
	 */
	public static int convertCard(Card card)
	{
		return numbers.get(card.getNumber()) * 4 + suits.get(card.getSuit()) + 1;
	}
	
	/**
	 * Converts a given list of cards into and int array of equivilent cards in the lookup table
	 * 
	 * @param card Card to be converted
	 * @return Card's int representation
	 */
	public static int[] convertHand(ArrayList<Card> cards)
	{
		int cardSize = cards.size();
		int cardsArray[] = new int[cardSize];
		
		for(int i = 0; i < cardSize; i++)
		{
			cardsArray[i] = convertCard(cards.get(i));
		}
		
		return cardsArray;
	}

}

package util;

import java.io.UnsupportedEncodingException;
import java.security.MessageDigest;
import java.security.NoSuchAlgorithmException;

/**
 * Util class for dealing with the encryption, and comparision of encrypted passwords,
 * and plaintext passwords. It also contains functions for converting strings to and from byte arrays.
 * 
 * @author dddurand
 *
 */
public class PasswordUtil {

	private static final String ENCODING = "UTF-8";
	private static final String ALGORITHM = "SHA-512";
	private static final String SIMPLE_SALT = "O1E jtl|a0%0|+#$cT}?H+-nS2zxy;2+an/Z`s|nCS-*-f_`U/V}Xo+OB``p$i+_";
	
	public PasswordUtil() { }
	
	/**
	 * One way encrypts a plaintext password.
	 * The result is returned as a string.
	 * 
	 * @param password Plaintext password.
	 * @return Encrypted password as a string.
	 */
	public String encrypt(String password) {
		String encryptedPassword = null;
		byte[] saltedPasswordBytes;
		MessageDigest digest;

		try{
			String saltedPassword = SIMPLE_SALT + password;
			saltedPasswordBytes = getBytesFromString(saltedPassword);
			digest = MessageDigest.getInstance(ALGORITHM);
			digest.reset();
			digest.update(saltedPasswordBytes);

			byte[] message = digest.digest();

			encryptedPassword = getStringFromBytes(message);
		} catch (NoSuchAlgorithmException e) {
			e.printStackTrace();
		} 

		return encryptedPassword; 
	}
	
	/**
	 * Compares a plaintext password, and an encrypted password.
	 * 
	 * @param plainPassword Plain text password
	 * @param encryptedPassword encrypted passwrd
	 * @return true on match, false otherwise
	 */
	public boolean compare(String plainPassword, String encryptedPassword)
	{
		
		String newEncryptedPassword = this.encrypt(plainPassword);
		
		if(encryptedPassword.equals(newEncryptedPassword))
			return true;
		else
			return false;
	}
	
	/**
	 * Converts a set of bytes into a string representation of the password.
	 * 
	 * @param passwordBytes Array of bytes presenting the password.
	 * @return The string equivalent password.
	 */
	public String getStringFromBytes(byte[] passwordBytes)
	{
		try {
			return new String(passwordBytes, ENCODING);
		} catch (UnsupportedEncodingException e) {
			e.printStackTrace();
		}
		
		return new String(passwordBytes);
	}
	
	/**
	 * Converts a provided string password, and returns the equivalent byte array.
	 * 
	 * @param password Password as a string.
	 * @return Byte array equivalent of the provided string.
	 */
	public byte[] getBytesFromString(String password)
	{
		try {
			return password.getBytes(ENCODING);
		} catch (UnsupportedEncodingException e) {
			e.printStackTrace();
		}
		
		return password.getBytes();
	}
	
}

