import javax.servlet.http.HttpServletResponse;

import services.AuthenticationService;
import services.SecureService;
import services.ServiceFactory;

import com.google.gson.Gson;

import database.DatabaseInterface.DatabaseInterfaceException;
import database.ResponseObject;

/**
 * Servlet implementation class RegisterServlet
 * 
 * This Servlet takes in a username and password, and generates
 * an authentication token. If an invalid username/password pair is given
 * and error is returned.
 * 
 * Input: {"username":"asdf","password":"asdf"}
 * Output: {"Success":"TRUE","Message":"TRUE","AuthenticationToken":"019f27e2-61b5-4046-a9c7-ecbb3c10295f"}
 */
//@WebServlet("/LoginServlet")
@WebServlet("/")
public class LoginServlet extends ConfigHttpServlet {
	private static final long serialVersionUID = 1L;
       
    /**
     * @see HttpServlet#HttpServlet()
     */
    public LoginServlet() {
        super();
        // TODO Auto-generated constructor stub
    }

	/**
	 * @see HttpServlet#doGet(HttpServletRequest request, HttpServletResponse response)
	 * 
	 * For Testing Purposes Only
	 * 
	 */
	protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
		AuthenticationService authService = new AuthenticationService();
		String message = authService.testDatabaseConnection();
		
		response.setContentType("text/html");
		
		Writer writer = response.getWriter();
		writer.write("<html>");
		writer.write(message);
		writer.write("</html>");
		
		
	}

	/**
	 * @see HttpServlet#doPost(HttpServletRequest request, HttpServletResponse response)
	 */
	protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
		String message;
		ServiceFactory factory = new ServiceFactory();
		
		try {
			String data = this.getPostData(request);
			SecureService service = factory.getService(this);
			message = service.loginSecuredProcess(data);
			service.close();
		} catch (DatabaseInterfaceException e) {
			Gson gson = new Gson();
			ResponseObject responseMsg = new ResponseObject(false, e.getMessage(), e.getCode());
			message = gson.toJson(responseMsg, ResponseObject.class);
		}
		
		this.outputMessage(response, message);
	}

}

package servlets;

import java.util.Calendar;
import java.util.Date;
import java.util.GregorianCalendar;
import java.util.Timer;

import javax.servlet.ServletConfig;
import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;

import util.RankCacheCron;

/**
 * Servlet for starting cron jobs.
 * 
 * @author dddurand
 *
 */
@WebServlet("/cron")
public class CronServlet extends ConfigHttpServlet {

	private static final long serialVersionUID = -7672762555376487388L;
	
	/**
	 * Run once per day
	 */
	final long dayInMili = 86400000;
	
	/**
	 * Timer for controlling rank cron jobs
	 */
	private final Timer rankCronTimer = new Timer();
	
	@Override
	public void init(ServletConfig config) throws ServletException {
		super.init(config);
		RankCacheCron rankCron = new RankCacheCron(this.getServletContext());
		rankCronTimer.schedule(rankCron, this.getTonightAtMidnight(), dayInMili);
	}
	
	/**
	 * Returns a date object for 5 minutes after midnight
	 * 
	 * @return
	 */
	private Date getTonightAtMidnight()
	{
		Calendar calender = new GregorianCalendar();	
		calender.add(Calendar.DAY_OF_MONTH, 1);
		
		calender.set(Calendar.HOUR_OF_DAY, 0);
		calender.set(Calendar.MINUTE, 5);
		calender.set(Calendar.SECOND, 0);
		calender.set(Calendar.MILLISECOND, 0);
		return calender.getTime();
	}
	
}

package servlets;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.Writer;

import javax.servlet.ServletException;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;

import util.ServletConfiguration;

/**
 * An extension to httpServlet that makes the object load its context
 * into ServletConfiguration in order to load the context parameters.
 * 
 * @author dddurand
 *
 */
public class ConfigHttpServlet extends HttpServlet {

	private static final long serialVersionUID = -1581925191750562160L;

	@Override
	/**
	 * On creation, attempt to load context into ServletConfiguration
	 */
	public void init() throws ServletException
     {
		 super.init();
		 ServletConfiguration.loadContext(this.getServletContext());
     }
	
	/**
	 * Retrieves the data provided in a post request.
	 * This function should only be called for getPost requests.
	 * 
	 * @param request getPost Request
	 * @return Data provided in a Post HttpServletRequest.
	 * 
	 * @throws ServletException
	 * @throws IOException
	 */
	protected String getPostData(HttpServletRequest request) 
										throws ServletException, IOException 
	{

		BufferedReader reader = request.getReader();
		
		StringBuilder builder = new StringBuilder();
		char[] charBuffer = new char[500];
		while(true)
		{
			int charsRead = reader.read(charBuffer);
			if(charsRead < 0) break;
			builder.append(charBuffer, 0, charsRead);
			
		}
		
		return builder.toString();
	}
	
	protected void outputMessage(HttpServletResponse response, String message) throws IOException
	{
		
		Writer writer = response.getWriter();
		response.setContentType("text/html");
		writer.write(message);
	}
	
}

