package services;

import com.google.gson.Gson;
import com.google.gson.GsonBuilder;

import dataModels.Filter;
import dataModels.UploadData;
import database.DatabaseInterface;
import database.ResponseObject;
import database.DatabaseInterface.DatabaseInterfaceException;

import servlets.CommunityStatisticsServlet;
import servlets.ConfigHttpServlet;
import servlets.LoginServlet;
import servlets.LogoutServlet;
import servlets.PersonalStatisticsServlet;
import servlets.RankingStatisticsServlet;
import servlets.RegisterServlet;
import servlets.TestServlet;
import servlets.UploadServlet;

/**
 * A class that acts as a factory of SecureService objects. The factory builds
 * the service object absed on the servlet that has been provided to the factory.
 * 
 * @author dddurand
 *
 */
public class ServiceFactory {

	/**
	 * Generic Constructor
	 */
	public ServiceFactory() { }
	
	/**
	 * The various supported servlets that will generate
	 * a specialized SecureService
	 * 
	 * @author dddurand
	 *
	 */
	public enum ServletType
	{
		LOGIN, LOGOUT, REGISTER, UPLOAD, PERSONAL, RANKING, COMMUNITY, UNKNOWN,TEST
	}
	
	/**
	 * Builds and retrieves the correct SecureService for a specific Servlet.
	 * 
	 * @param servlet The servlet the service if for.
	 * @return The specifically built SecureService.
	 * @throws DatabaseInterfaceException
	 */
	public SecureService getService(ConfigHttpServlet servlet) throws DatabaseInterfaceException
	{
		ServletType servletType = getServletType(servlet);
		Gson gson = generateGSON(servletType);
		DatabaseInterface dbInterface = new DatabaseInterface();
		
		ServiceDelegate delegate = generateServiceDelegate(servletType,gson, dbInterface);
		
		return new SecureService(delegate, gson, dbInterface);
	}
	
	
	/**
	 * Generates the appropriate delegate object, based on which Servlet the service is for.
	 * 
	 * @param servletType The type of servlet the delegate is for.
	 * @param gson The gson object to be used in the delegate.
	 * @param dbInterface The database interface to be used in the delegate.
	 * @return
	 */
	private ServiceDelegate generateServiceDelegate(ServletType servletType, Gson gson, DatabaseInterface dbInterface)
	{

		switch(servletType)
		{	
		case LOGIN:
			return new LoginDelegate(gson, dbInterface);
		case LOGOUT:
			return new LogoutDelegate(gson, dbInterface);
		case REGISTER:
			return new RegisterDelegate(gson, dbInterface);
		case UPLOAD:
			return new UploadDelegate(gson, dbInterface);
		case PERSONAL:
			return new PersonalStatisticsDelegate(gson, dbInterface);
		case RANKING:
			return new RankingStatisticsDelegate(gson, dbInterface);
		case COMMUNITY:
			return new CommunityStatisticsDelegate(gson, dbInterface);
		case TEST:
			return new TestDelegate(gson, dbInterface);
		default:
			return new ServiceDelegate(gson, dbInterface);
		}
	}
	
	/**
	 * Builds the gson object, that will be used by the service.
	 * Custom additions are added to the gson object as needed
	 * by the specific servlet types.
	 * 
	 * @param servletType The type of servlet the gson will be used in.
	 * @return The built gson object.
	 */
	private Gson generateGSON(ServletType servletType)
	{
		GsonBuilder gsonBuilder = new GsonBuilder();
		
		switch(servletType)
		{	
		case LOGIN:
		case LOGOUT:
		case REGISTER:
			gsonBuilder.registerTypeAdapter(ResponseObject.class, new ResponseObject.ResponseSerializer());
			break;
		
		case COMMUNITY:
		case RANKING:
		case PERSONAL:
		case UPLOAD:
		case TEST:
			gsonBuilder.registerTypeAdapter(ResponseObject.class, new ResponseObject.ResponseSerializer());
			gsonBuilder.registerTypeAdapter(UploadData.class, new UploadData.UploadDataDeserializer());
			gsonBuilder.registerTypeAdapter(Filter.class, new Filter.FilterDeserializer());
		default:
			break;
		}
		
		return gsonBuilder.create();
	}
	
	/**
	 * Determines what type of servlet has been provided
	 * to the factory.
	 * 
	 */
	private ServletType getServletType(ConfigHttpServlet servlet)
	{
		if(servlet instanceof LoginServlet)
			return ServletType.LOGIN;
		else if(servlet instanceof LogoutServlet)
			return ServletType.LOGOUT;
		else if(servlet instanceof RegisterServlet)
			return ServletType.REGISTER;
		else if(servlet instanceof UploadServlet)
			return ServletType.UPLOAD;
		else if(servlet instanceof TestServlet)
			return ServletType.TEST;
		else if(servlet instanceof PersonalStatisticsServlet)
			return ServletType.PERSONAL;
		else if(servlet instanceof RankingStatisticsServlet)
			return ServletType.RANKING;
		else if (servlet instanceof CommunityStatisticsServlet)
			return ServletType.COMMUNITY;
		else
			return ServletType.UNKNOWN;
	}
}

package services;

import com.google.gson.Gson;

import dataModels.Account;
import database.DatabaseInterface;
import database.DatabaseInterface.DatabaseInterfaceException;

/**
 * The framework for a service delegate.
 * This object can be instantiated, but all its methods simply
 * return "Not Implemented". 
 * 
 * This object is mean't to be extended, and then added into the ServiceFactory.
 * These delegate objects act as the backbone of a service, and provide their main
 * functionality. Any custom additions needed by GSON objects should be added in the factory.
 * 
 * @author dddurand
 *
 */
public class ServiceDelegate {

	protected Gson gson;
	protected DatabaseInterface dbInterface; 
	
	/**
	 * General constructor
	 * 
	 * @param gson Gson object used by the serviceDelegate
	 * @param dbInterface DatabaseInterface used by the delegate
	 */
	public ServiceDelegate(Gson gson, DatabaseInterface dbInterface)
	{
		this.gson = gson;
		this.dbInterface = dbInterface;
	}
	
	/**
	 * Setter for the Gson Object
	 * 
	 * @param gson
	 */
	public void setGson(Gson gson)
	{
		this.gson = gson;
	}
	
	/**
	 * Setter for the Database interface
	 * 
	 * @param dbInterface
	 */
	public void setDatabaseInterface(DatabaseInterface dbInterface)
	{
		this.dbInterface = dbInterface;
	}
	
	/**
	 * This function is called by a SecureService when it has determined the connection
	 * has a valid username and auth token.
	 * 
	 * @param postAccount Authenticated account provided at login
	 * @param postData Data provided to the web service
	 * @return JSON Result
	 * @throws DatabaseInterfaceException
	 */
	public String applyAuthProcess(Account postAccount, String postData) throws DatabaseInterfaceException
	{
		return "Not Implemented.";
	}
	
	/**
	 * This function is called by a SecureService when it has determined the connection
	 * has a valid username and password.
	 * 
	 * @param postAccount Validated login account
	 * @param postData Data provided to the web service
	 * @return JSON Result
	 * @throws DatabaseInterfaceException
	 */
	public String applyLoginProcess(Account account, String postData) throws DatabaseInterfaceException
	{
		return "Not Implemented.";
	}
	
	/**
	 * This function is called by a SecureService without any checks.
	 * @param postAccount Authenticated account provided at login
	 * @param postData Data provided to the web service
	 * @return JSON Result
	 * @throws DatabaseInterfaceException
	 */
	public String unsecureProcess(Account account, String postData) throws DatabaseInterfaceException
	{
		return "Not Implemented.";
	}
	
	/**
	 * Should be called after the service's work has been completed.
	 * No calls should be made on this object after this has been called.
	 * 
	 */
	public void close()
	{
		this.dbInterface.close();
	}
}

package services;

import util.Codes;

import com.google.gson.Gson;
import com.google.gson.JsonParseException;
import com.google.gson.JsonSyntaxException;

import dataModels.Account;
import database.DatabaseInterface;
import database.ResponseObject;
import database.DatabaseInterface.DatabaseInterfaceException;

/**
 * The main logic for authentication to the web service. Other than the logic for
 * authentication, the work done by the service is determined by the the delegate
 * provided at creation.
 * 
 * @author dddurand
 *
 */
public class SecureService {

	private ServiceDelegate service;
	
	private Gson gson;
	private DatabaseInterface dbInterface;
	
	/**
	 * General Constructor
	 * 
	 * @param delegate The workhorse of the function, providing the main functionality.
	 * @param gson The object to serialize/deserialize JSON
	 * @param dbInterface The main interface to the database
	 */
	public SecureService(ServiceDelegate delegate, Gson gson, DatabaseInterface dbInterface)
	{
		this.service = delegate;
		this.gson = gson;
		this.dbInterface = dbInterface;
	}
	
	/**
	 * Getter for the GSON object
	 * 
	 * @return
	 */
	protected Gson getGson()
	{
		return this.gson;
	}
	
	/**
	 * Getter for the databaseInterface
	 * @return
	 */
	protected DatabaseInterface getdbInterface()
	{
		return this.dbInterface;
	}
	
	/**
	 * Given request data containing JSON with a valid account username and auth token,
	 * this function will call the delegates auth function. This will be overwritten
	 * in delegate to provide the desired functionality, that should only occur when a 
	 * valid username and auth token is valid.
	 * 
	 * On Failure the user will be informed.
	 * Ex Failure: {"Success":"FALSE","Message":"Invalid Username \u0026 Authentication Token"}
	 * 
	 * @param requestData
	 * @return JSON data
	 */
	public final String authSecuredProcess(String postData)
	{
			try
			{
				//Pull the account information out of the json
				Account account = gson.fromJson(postData, Account.class);
				
				//empty username
				if(account == null || account.getUsername()==null || account.getUsername().isEmpty())
				{
					return generateError("Invalid username", Codes.INVALID_USERNAME);
				}
				
				//empty auth token
				if(account.getAuthenticationToken()==null || account.getAuthenticationToken().isEmpty())
				{
					return generateError("Invalid auth token", Codes.INVALID_AUTH);
				}
				
				
				//Get the account with the same username
				Account accountFromDB = dbInterface.getAccount(account.getUsername());
				
				//No account was found for given username
				if(accountFromDB == null)
				{
					return generateUsernameNotFoundError();
				} 
				//Valid account
				else
				{	
					
					//Account login valid
					if(accountFromDB.compareAuthenticated(account))
					{
						return service.applyAuthProcess(accountFromDB, postData);
					}
					//Invalid username/password combo
					else
					{
						return generateInvalidAuthError();
					}
				}
				
				
			} catch (DatabaseInterfaceException e) {
				return generateError(e.getMessage(), e.getCode());
			}
			catch (JsonSyntaxException e)
			{
				return generateInvalidDataError();
			}
			catch (JsonParseException e)
			{
				return generateInvalidDataError();
			}
	}
	
	/**
	 * Given request data containing JSON with a valid account username and password,
	 * this function will call the delegates login function. This will be overwritten
	 * in delegate to provide the desired functionality, that should only occur when a 
	 * valid username and password is valid.
	 * 
	 * On Failure the user will be informed.
	 * Ex Failure: {"Success":"FALSE","Message":"Invalid Username \u0026 Authentication Token"}
	 * 
	 * @param requestData
	 * @return JSON data
	 */
	public final String loginSecuredProcess(String postData)
	{
		try
		{
			//Load account from post data
			Account account = gson.fromJson(postData, Account.class);
			
			
			
			//empty username
			if(account == null || account.getUsername()==null || account.getUsername().isEmpty())
			{
				return generateError("Invalid username", Codes.INVALID_USERNAME);
			}
			
			//empty password
			if(account.getPassword()==null || account.getPassword().isEmpty())
			{
				return generateError("Invalid password", Codes.INVALID_PASSWORD);
			}
			
			//get account from database
			Account accountFromDB = dbInterface.getAccount(account.getUsername());
			
			//No Valid Account
			if(accountFromDB == null)
			{
				ResponseObject response = new ResponseObject(false, "User Not Found", Codes.NO_ACCOUNT);
				return gson.toJson(response, ResponseObject.class);
			} 
			//Valid account
			else
			{
				//Account login valid
				if(accountFromDB.compareLogin(account))
				{
					return this.service.applyLoginProcess(accountFromDB, postData);
				}
				//Invalid username/password combo
				else
				{
					return generateInvalidLoginError();
				}
			}
			
			
		} catch (DatabaseInterfaceException e) {
			return generateError(e.getMessage(), e.getCode());
		}
		catch (JsonSyntaxException e)
		{
			return generateInvalidDataError();
		}
		catch (JsonParseException e)
		{
			return generateInvalidDataError();
		}
	}
	
	/**
	 * Does not explicitly checks for any auth verification.
	 * The call is simply passed on to the delegate, once the account
	 * provided is determined.
	 * 
	 * @param postData Data passed to the web service.
	 * @return
	 */
	public final String unsecuredProcess(String postData)
	{
		try
		{
			//Load account from post data
			Account account = gson.fromJson(postData, Account.class);
			
			if(account == null) return generateError("Invalid Username Provided", Codes.INVALID_USERNAME);
			
			
			return this.service.unsecureProcess(account, postData);
			
		} catch (DatabaseInterfaceException e) {
			return generateError(e.getMessage(), e.getCode());
		}
		catch (JsonSyntaxException e)
		{
			return generateInvalidDataError();
		}
		catch (JsonParseException e)
		{
			return generateInvalidDataError();
		}
	}
	
	/**
	 * Returns the error for the case when a username has no matching account
	 * @return
	 */
	private String generateUsernameNotFoundError()
	{
		return generateError("The provided username is not registered.", Codes.NO_ACCOUNT);
	}
	
	/**
	 * Returns the error when a username/password pair is invalid.
	 * @return
	 */
	private String generateInvalidLoginError()
	{
		return generateError("Invalid Login.", Codes.INVALID_LOGIN);
	}
	
	/**
	 * Returns the error used when an username/auth is invalid.
	 * @return
	 */
	private String generateInvalidAuthError()
	{
		return generateError("The provided authtoken and username is invalid.", Codes.NOT_AUTHED);
	}
	
	/**
	 * Returns the error used when the data provided is invalid.
	 * @return
	 */
	protected String generateInvalidDataError()
	{
		return generateError("Invalid post data.", Codes.INVALID_DATA);
	}
	
	/**
	 * Returns and error
	 * 
	 * @param message
	 * @return
	 */
	protected String generateError(String message, int code)
	{
		ResponseObject response = new ResponseObject(false, message, code);
		return gson.toJson(response, ResponseObject.class);
	}
	
	/**
	 * Clean up method for the service.
	 * All actions made on this object after calling this method is undefined.
	 * 
	 */
	public void close()
	{
		this.service.close();
	}
	
}

package services;

import util.Codes;

import com.google.gson.Gson;

import dataModels.Account;
import database.DatabaseInterface;
import database.DatabaseInterface.DatabaseInterfaceException;
import database.ResponseObject;

/**
 * The ServiceDelegate extension that deals with the process of creating new accounts.
 * 
 * @author dddurand
 *
 */
public class RegisterDelegate extends ServiceDelegate{

	/**
	 * General Constructor
	 * 
	 * @param gson The gson object to be used to convert from / to JSON strings.
	 * @param dbInterface The interface to the external database.
	 */
	public RegisterDelegate(Gson gson, DatabaseInterface dbInterface) {
		super(gson, dbInterface);
	}

	/**
	 * The process used to generate a new account for the webservice
	 */
	@Override
	public String unsecureProcess(Account account, String postData)
			throws DatabaseInterfaceException {
			
			if(account.getUsername() == null || account.getUsername().isEmpty())
			{
				ResponseObject response = new ResponseObject(false, "Invalid Username Provided", Codes.INVALID_USERNAME);
				return gson.toJson(response, ResponseObject.class);
			}
			
			if(account.getPassword() == null || account.getPassword().isEmpty())
			{
				ResponseObject response = new ResponseObject(false, "Invalid Password Provided", Codes.INVALID_PASSWORD);
				return gson.toJson(response, ResponseObject.class);
			}
			
			if(dbInterface.isDuplicateUsername(account.getUsername()))
			{
				ResponseObject response = new ResponseObject(false, "Username already in use.", Codes.DUPLICATE_USERNAME);
				return gson.toJson(response, ResponseObject.class);
			}
			
			dbInterface.addAccount(account);
			ResponseObject response = new ResponseObject(true, ResponseObject.SUCCESS, Codes.SUCCESS);
			return gson.toJson(response, ResponseObject.class);
		
	}

}

package services;

import java.util.ArrayList;

import util.Codes;

import com.google.gson.Gson;

import dataModels.Account;
import dataModels.Filter;
import dataModels.PersonalStatistics;
import dataModels.RankingStatistics;
import dataModels.RankingStatistics.RankedDataRow;
import database.DatabaseInterface;
import database.DatabaseInterface.DatabaseInterfaceException;
import database.ResponseObject;

public class RankingStatisticsDelegate extends ServiceDelegate{

	public RankingStatisticsDelegate(Gson gson, DatabaseInterface dbInterface) {
		super(gson, dbInterface);
		// TODO Auto-generated constructor stub
	}
	
	/**
	 * Processes data in the database, and returns an ordered list of users
	 * based on a ranking value.
	 * 
	 * 
	 */
	@Override
	public String applyAuthProcess(Account postAccount, String postData)
			throws DatabaseInterfaceException {

		Filter filter = gson.fromJson(postData, Filter.class);
		
		ArrayList<RankedDataRow> rankData = dbInterface.getRankedUsers(filter);

		PersonalStatistics personalStats = new PersonalStatistics(postAccount, dbInterface, filter);
		RankedDataRow myRankData = personalStats.getMyRating();
		
		RankingStatistics statistics = new RankingStatistics(rankData, myRankData);
		
		ResponseObject responseObject = new ResponseObject(true, "Ranking Results", Codes.SUCCESS);
		responseObject.setRankingStatistics(statistics);
		
		String result = gson.toJson(responseObject);
		
		return result;

	}


}

