	/**
	 * A generalized function that either sums, or averages a numerable column in the game_action table of the database.
	 * There is a filtering poker action that limits what values are determined. If null is provided for the PokerAction,
	 * all actions are considered. There is also a parameter that allows zero values to be ignored.
	 * 
	 * @param account The account to be considered.
	 * @param op The operation to be considered.
	 * @param column The column to run the operation on.
	 * @param action A filtering action.
	 * @param ignoreZeroValues Wheither to ignore zero values or not.
	 * @return The result of the operation.
	 * @throws DatabaseInterfaceException
	 */
	public int getGameActionsTypedNum(Account account, NumerableActionOperation op,
									NumerableActionColumn column, PokerAction action, boolean ignoreZeroValues, Filter filter) throws DatabaseInterfaceException
	{
		String typeLimit = "";
		String ignoreZero = "";
		String accountFiltering = "";
		
		if(action != null)
			typeLimit = " and type = '"+ action.getValue()+"' ";
		
		if(account !=null)
			accountFiltering = " and accountID = "+account.getAccountID()+" ";
		
		if(ignoreZeroValues)
			ignoreZero = " and " + column.getValue() + "<> 0";
		
		
		
		String sql = "SELECT "+op.getValue()+"("+column.getValue()+") from " + GAME_ACTION_TABLE +
					 " WHERE TRUE "+typeLimit+" "+accountFiltering+" "+ignoreZero+" "+filter.getSqlTimeFrameFilter()+" ;";
		
		try
		{
			CallableStatement prepStat = dbConnection.prepareCall(sql);
			
			ResultSet set = prepStat.executeQuery();
			int count = 0;
			
			if(set.next())
			{
				count = set.getInt(1);
			}
			
			prepStat.close();
			return count;
			
			} catch (SQLException e) {
				throw new DatabaseInterfaceException("Error retrieving SUM statistic", e,  Codes.DATABASE);
			}
	}
	
	/**
	 * Adds a entry to the game optimality for the game. This includes a optimality rating for that game.
	 * 
	 * 
	 * @param account
	 * @return
	 * @throws DatabaseInterfaceException
	 */
	public boolean setGameOptimalityForUser(Account account, Game game, double optimality) throws DatabaseInterfaceException
	{
		int gameId = getGameDatabaseID(game);
		
		if(this.optimalityExists(gameId, account.getAccountID())) return true;
		
		String insertAccountSQL = "INSERT INTO game_optimality (game_id, account_id, optimality) VALUES (?,?,?);";
		
		try {
			CallableStatement prepStat = dbConnection.prepareCall(insertAccountSQL);

			prepStat.setInt(1, gameId);
			prepStat.setInt(2, account.getAccountID());
			prepStat.setDouble(3, optimality);

			prepStat.execute();
			prepStat.close();
		} catch (SQLException e) {
			throw new DatabaseInterfaceException("Unable to store optimality value for game.", e,  Codes.DATABASE);
		}

		return false;

	}
	
	/**
	 * Retrieves an optimality rating for the user, based on a given timeframe in the filter
	 * 
	 * @param account
	 * @return
	 * @throws DatabaseInterfaceException
	 */
	public double getUserOptimality(Account account, Filter filter) throws DatabaseInterfaceException
	{
		
		String sql = "SELECT avg(optimality) FROM game_optimality JOIN games ON game_optimality.game_id = games.id WHERE account_id = ? "+filter.getSqlTimeFrameFilter()+" ;";
		
		try {
			CallableStatement prepStat = dbConnection.prepareCall(sql);

			prepStat.setInt(1, account.getAccountID());

			ResultSet set = prepStat.executeQuery();
			double count = 0;
			
			if(set.next())
			{
				count = set.getDouble(1);
			}
			
			prepStat.close();
			return count;
			
		} catch (SQLException e) {
			throw new DatabaseInterfaceException("Unable to retrieve optimality value for user.", e,  Codes.DATABASE);
		}

	}
	
	public void close()
	{
		try {
			this.dbConnection.close();
		} catch (SQLException e) { }
	}
	
	/**
	 * Centralizes all Exceptions caused by DatabaseInterface.
	 * 
	 * @author dddurand
	 *
	 */
	public class DatabaseInterfaceException extends Exception
	{
		/**
		 * 
		 */
		private static final long serialVersionUID = -3785824197570821055L;
		private int code = Codes.DATABASE;
		
		/**
		 * Empty Exception
		 */
		public DatabaseInterfaceException()
		{
			super();
		}
		
		/**
		 * New exception with a specific message
		 * @param message
		 */
		public DatabaseInterfaceException(String message, int code)
		{
			super(message);
			this.code = code;
		}
		
		/**
		 * Generate an exception based on one that already exists, along with
		 * an additional message.
		 * 
		 * @param message
		 * @param e An existing exception.
		 */
		public DatabaseInterfaceException(String message, Exception e, int code)
		{
			super(message, e);
		}
		
		/**
		 * Create a new exception from one that already exists.
		 * 
		 * @param e An existing exception.
		 */
		public DatabaseInterfaceException(Exception e)
		{
			super(e);
		}
		
		/**
		 * Returns code number
		 * @return
		 */
		public int getCode()
		{
			return this.code;
		}
	}
	
	/**
	 * All the possible numberable operations for querying
	 * 
	 * @author dddurand
	 *
	 */
	public enum NumerableActionOperation
	{
		SUM("SUM"), AVG("AVG");
		
		private String value;
		
		NumerableActionOperation(String value)
		{
			this.value = value;
		}
		
		public String getValue()
		{
			return this.value;
		}
		
	}
	
	/**
	 * All possible columns that NumerableActionsOperations
	 * can act upon.
	 * 
	 * @author dddurand
	 *
	 */
	public enum NumerableActionColumn
	{
		POT("pot"), BET("bet");
		
		private String value;
		
		NumerableActionColumn(String value)
		{
			this.value = value;
		}
		
		public String getValue()
		{
			return this.value;
		}
		
	}
	
}

package dataModels;

import java.lang.reflect.Type;
import java.util.ArrayList;

import com.google.gson.JsonArray;
import com.google.gson.JsonDeserializationContext;
import com.google.gson.JsonDeserializer;
import com.google.gson.JsonElement;
import com.google.gson.JsonObject;
import com.google.gson.JsonParseException;

import dataModels.GameAction.PokerAction;

/**
 * Acts as the data representation for the game & misc data uploaded to the web service.
 * This class also contains the code to convert the JSON provided to the webservice, into
 * the UploadData model.
 * 
 * @author dddurand
 *
 */
public class UploadData {

	private ArrayList<Game> games;
	private ArrayList<MiscGameData> miscDatas;

	/**
	 * General Constructor
	 */
	public UploadData() {}

	/**
	 * General Constructor
	 * 
	 * @param games The games data to be uploaded
	 * @param otherdata The misc data to be uploaded
	 */
	public UploadData(ArrayList<Game> games, ArrayList<MiscGameData> otherdata)
	{
		this.games = games;
		this.miscDatas = otherdata;
	}

	
	/**
	 * Games Getter
	 * 
	 * @return
	 */
	public ArrayList<Game> getGames() {
		return games;
	}

	/**
	 * Games Setter
	 * 
	 * @param games
	 */
	public void setGames(ArrayList<Game> games) {
		this.games = games;
	}

	/**
	 * Misc Datas Getter
	 * 
	 * @return
	 */
	public ArrayList<MiscGameData> getMiscDatas() {
		return miscDatas;
	}
	
	/**
	 * MiscDatas Setter
	 * 
	 * @param miscDatas
	 */
	public void setMiscDatas(ArrayList<MiscGameData> miscDatas) {
		this.miscDatas = miscDatas;
	}

	/**
	 * Custom Deserializer that takes the provided json,
	 * and converts it into a UploadData object.
	 * 
	 * @author dddurand
	 *
	 */
	public static class UploadDataDeserializer implements JsonDeserializer<UploadData> {

		/**
		 * Generates a game from the json data
		 * 
		 * @param gameObject
		 * @return
		 */
		private Game createGame(JsonObject gameObject)
		{
			String game_id = gameObject.get("gameID").getAsString();

			if(game_id == null || game_id.isEmpty())
				throw new JsonParseException("Invalid Game ID");

			JsonArray actions = gameObject.get("gameActions").getAsJsonArray();
			ArrayList<GameAction> actionList = createGameActionList(actions);

			Game game = new Game(actionList, game_id);

			return game;
		}

		/**
		 * Generates a game action collection from the json data
		 * 
		 * @param actions
		 * @return
		 */
		private ArrayList<GameAction> createGameActionList(JsonArray actions)
		{
			int actionsCount = actions.size();
			ArrayList<GameAction> actionList = new ArrayList<GameAction>();

			for(int j = 0; j < actionsCount; j++)
			{
				JsonObject actionObject =  actions.get(j).getAsJsonObject();

				GameAction action =  createGameAction(actionObject);

				actionList.add(action);
			}

			return actionList;
		}

		/**
		 * Generates a game action from the json data
		 * 
		 * @param actionObject
		 * @return
		 */
		private GameAction createGameAction(JsonObject actionObject)
		{
			String actionString = actionObject.get("action").getAsString();

			PokerAction pokerAction = PokerAction.getAction(actionString);

			if(pokerAction == PokerAction.UNKNOWN)
				throw new JsonParseException("Invalid game action");

			int pot = actionObject.get("pot").getAsInt();
			int bet = actionObject.get("bet").getAsInt();
			String hand = actionObject.get("hand").getAsString();
			String comm = actionObject.get("communityCards").getAsString();

			if(hand != null && hand.length() != 5 && !Card.validCardString(hand))
				throw new JsonParseException("Invalid Hand");
			if(comm != null && !comm.isEmpty() && !Card.validCardString(comm))
				throw new JsonParseException("Invalid Community Card Data");

			ArrayList<Card> handList = Card.generateCards(hand);
			ArrayList<Card> commList = Card.generateCards(comm);

			GameAction action = new GameAction(pokerAction, pot, bet, handList, commList);

			return action;
		}

		/**
		 * Generates a list of game objects from the json data
		 * 
		 * @param games
		 * @return
		 */
		private ArrayList<Game> generateGameList(JsonArray games)
		{
			int gamesCount = games.size();
			ArrayList<Game> gameList = new ArrayList<Game>();

			for(int i = 0; i < gamesCount; i++)
			{
				try{
					JsonObject gameObject =  games.get(i).getAsJsonObject();	
					Game game = createGame(gameObject);
					gameList.add(game);
				}
				catch (JsonParseException e)
				{
					gameList.add(null);
				}
			}

			return gameList;
		}

		/**
		 * Generates a collection of MiscGameData objects from the provided json
		 * 
		 * @param miscDatas
		 * @return
		 */
		private ArrayList<MiscGameData> createMiscList(JsonArray miscDatas)
		{
			int miscCount = miscDatas.size();
			ArrayList<MiscGameData> miscList = new ArrayList<MiscGameData>();

			for(int i = 0; i < miscCount; i++)
			{
				try{
					JsonObject miscObj = miscDatas.get(i).getAsJsonObject();

					String name = miscObj.get("name").getAsString();
					String value = miscObj.get("value").getAsString();


					MiscGameData miscData = new MiscGameData(name, value);
					miscList.add(miscData);
				}
				catch (JsonParseException e)
				{
					miscList.add(null);
				}
			}

			return miscList;
		}

		/**
		 * The custom serializer that converts the provided json,
		 * into a UploadData object.
		 * 
		 */
		@Override
		public UploadData deserialize(JsonElement element, Type type,
				JsonDeserializationContext context) throws JsonParseException {

			JsonObject uploadDataObj = element.getAsJsonObject();

			JsonArray games = uploadDataObj.get("games").getAsJsonArray();

			JsonArray miscDatas = uploadDataObj.get("miscDatas").getAsJsonArray();

			ArrayList<Game> gameList = generateGameList(games);
			ArrayList<MiscGameData> miscList = createMiscList(miscDatas);

			UploadData uploadData = new UploadData(gameList, miscList);

			return uploadData;
		}
	}

}

